import { Component, OnInit } from '@angular/core';
import { RouterOutlet } from '@angular/router';
import { MatIcon } from '@angular/material/icon';
import { MatDrawer, MatDrawerContainer } from '@angular/material/sidenav';

@Component({
  selector: 'app-root',
  standalone: true,
  imports: [ RouterOutlet, MatIcon, MatDrawerContainer, MatDrawer ],
  templateUrl: './app.component.html',
  styleUrl: './app.component.scss'
})

export class AppComponent implements OnInit {
  ngOnInit() {
  }
}
<mat-drawer-container class="grid place-items-center h-screen bg-blue-100" [hasBackdrop]="true">
    <mat-drawer #drawer [mode]="'over'">I'm a drawer</mat-drawer>
    <mat-drawer-content>
        <div class="flex gap-1">

            <div class="flex flex-col gap-1">
                @for (i of [7, 6, 5, 4]; track i) {
                    <button
                            class="w-[60px] h-[161.4px] hover:scale-[1.03] duration-100 bg-[url('/assets/img/bg-container-vertical.png')] bg-no-repeat bg-center bg-cover text-xl text-white font-medium flex-shrink-0"
                    >{{ i }}</button>
                }
            </div>

            <div class="flex flex-col justify-between">
                <div class="flex gap-1">
                    @for (i of [8, 9, 10, 11, 12]; track i) {
                        <button
                                class="w-[161.4px] h-[60px] hover:scale-[1.03] duration-100 bg-[url('/assets/img/bg-container.png')] bg-no-repeat bg-center bg-cover text-xl text-white font-medium flex-shrink-0"
                        >{{ i }}</button>
                    }
                </div>
                <div class="flex gap-1">
                    @for (i of [3, 2, 1, 18, 17]; track i) {
                        <button
                                class="w-[161.4px] h-[60px] hover:scale-[1.03] duration-100 bg-[url('/assets/img/bg-container.png')] bg-no-repeat bg-center bg-cover text-xl text-white font-medium flex-shrink-0"
                        >{{ i }}</button>
                    }
                </div>
            </div>

            <div class="flex flex-col gap-1">
                @for (i of [13, 14, 15, 16]; track i) {
                    <button
                            class="w-[60px] h-[161.4px] hover:scale-[1.03] duration-100 bg-[url('/assets/img/bg-container-vertical.png')] bg-no-repeat bg-center bg-cover text-xl text-white font-medium flex-shrink-0"
                    >{{ i }}</button>
                }
            </div>

        </div>
    </mat-drawer-content>
</mat-drawer-container>
